import axios from "axios";
import Card from "../../components/Card";

export default function NewReq() {
  const [request, setRequest] = useState([]);

  useEffect(() => {
    axios
      .get("http://127.0.0.1:8081/user/platform/showNewRequest")
      .then((res) => {
        setRequest(res.data);
      })
      .catch((err) => {
        console.error(err);
      });
  }, []);

  // const saveData = () => {
